import React from "react";
import styles from "./List.module.css";
import Datetime from "../Date/Datetime";
import{ FontAwesomeIcon} from "@fortawesome/react-fontawesome";
import{ faCloud, faCloudMoonRain, faCloudRain, faMoon, faSun, faWind } from "@fortawesome/free-solid-svg-icons";
const List= ({city, temp, winds,clima, data,hora,forecast})=> {
var condicion;
var dat="";
var url= "http://openweathermap.org/img/w/";
var descripcion="";
var forecastDate3="";
var forecastDate6="";
var forecastDate9="";
var iconUrl3="";
var iconUrl6="";
var iconUrl9="";
var forecastDayDescription="";
var forecastDayWeather="";
var horaString= hora.toString().slice(10,-42);
var horaLocal= horaString.slice(5)
    if(city){
        const $clima= clima[0].description;
       if($clima==="clear sky" && (Number(horaLocal)<10 || Number(horaLocal)>=19 )){
            condicion=<FontAwesomeIcon className={styles.icono} icon={faMoon}/>
            descripcion="";
        }
            dat= url + city.weather[0].icon + ".png";
            descripcion= city.weather[0].description;
            forecastDate3 = forecast.list[2].dt_txt.substring(8, 10) + '/' + forecast.list[1].dt_txt.substring(5, 7) + '/' + forecast.list[1].dt_txt.substring(0, 4) + ' ' +  forecast.list[1].dt_txt.substring(11, 13);
            forecastDate6 = forecast.list[10].dt_txt.substring(8, 10) + '/' + forecast.list[2].dt_txt.substring(5, 7) + '/' + forecast.list[2].dt_txt.substring(0, 4) + ' ' +  forecast.list[2].dt_txt.substring(11, 13);
            forecastDate9 = forecast.list[20].dt_txt.substring(8, 10) + '/' + forecast.list[3].dt_txt.substring(5, 7) + '/' + forecast.list[3].dt_txt.substring(0, 4) + ' ' +  forecast.list[3].dt_txt.substring(11, 13);
            iconUrl3 = url + city.weather[0].icon + ".png";
            iconUrl6 = url + forecast.list[10].weather[0].icon + ".png";
            iconUrl9 = url + forecast.list[20].weather[0].icon + ".png";
            forecastDayDescription=  forecast.list[1].weather[0].description;
            forecastDayWeather= forecast.list[3].main.temp ;
        }
 
    return (
        <div className={styles.lopadre}>

    <div className={styles.container}>
        <div className={styles.dateTime}>
            <Datetime />
        </div>

        <div className={styles.header}>
            <div className={styles.firstSun}>
                <div className={styles.cityName}>
                    <h1>{city.name}</h1>
                </div>
                <div className={styles.cityHour}>
                    {
                    hora.toString().slice(10,-33)
                    }
                </div>
            </div>
           <div className={styles.secondSun}>
                <div className={styles.icon}>
                <h1><img className={styles.img} src={dat} alt="" /> </h1>
                <h6> {descripcion}</h6>
                <h2> {condicion} </h2>
                </div>
                <div className={styles.temperature}>
                    <h1>{temp.temp}º</h1>  
                </div>
                <div className={styles.adds}> 
                    <h5>Feels like: {temp.feels_like}º</h5>
                    <h6>Min: {temp.temp_min}º</h6>
                    <h6>Max: {temp.temp_max}º</h6>
                    <h6>Humidity: {temp.humidity}% </h6>
                    <div className={styles.windSpeed}>
                     <FontAwesomeIcon className={styles.icono} icon={faWind}/> 
                       <h5>Wind: { winds.speed} m/s </h5>
                    </div>
                </div>
           </div> 
        </div>     
        <div className={styles.prueba}>
            <h5>{forecastDate3}</h5>   
            <img src={iconUrl3} alt=""/>  
            <h5> {forecastDayDescription}</h5> <br />
            <h5>{forecastDayWeather}Cº </h5>
        </div>
    </div>
    </div>

    );}
  export default List;
